  d_nlp.ubx = arg[3];
  d_nlp.lbg = arg[4];
  d_nlp.ubg = arg[5];
  d_nlp.x0 = arg[0];
  d_nlp.lam_x0 = arg[6];
  d_nlp.lam_g0 = arg[7];
  d_nlp.x = res[0];
  d_nlp.f = res[1];
  d_nlp.g = res[2];
  d_nlp.lam_x = res[3];
  d_nlp.lam_g = res[4];
  d_nlp.lam_p = res[5];
  d_nlp.prob = &p_nlp;
  p_nlp.nx = 108;
  p_nlp.ng = 72;
  p_nlp.np = 171;
  p_nlp.detect_bounds.ng = 0;
  casadi_nlpsol_init(&d_nlp, &arg, &res, &iw, &w);
  if (d_nlp.x0) {
    casadi_copy(d_nlp.x0, 108, d_nlp.z);
  } else {
    casadi_clear(d_nlp.z, 108);
  }
  if (d_nlp.lbx) {
    casadi_copy(d_nlp.lbx, 108, d_nlp.lbz);
  } else {
    casadi_fill(d_nlp.lbz, 108, -casadi_inf);
  }
  if (d_nlp.ubx) {
    casadi_copy(d_nlp.ubx, 108, d_nlp.ubz);
  } else {
    casadi_fill(d_nlp.ubz, 108, casadi_inf);
  }
  if (d_nlp.lam_x0) {
    casadi_copy(d_nlp.lam_x0, 108, d_nlp.lam);
  } else {
    casadi_clear(d_nlp.lam, 108);
  }
  if (d_nlp.lbg) {
    casadi_copy(d_nlp.lbg, 72, d_nlp.lbz+108);
  } else {
    casadi_fill(d_nlp.lbz+108, 72, -casadi_inf);
  }
  if (d_nlp.ubg) {
    casadi_copy(d_nlp.ubg, 72, d_nlp.ubz+108);
  } else {
    casadi_fill(d_nlp.ubz+108, 72, casadi_inf);
  }
  if (d_nlp.lam_g0) {
    casadi_copy(d_nlp.lam_g0, 72, d_nlp.lam+108);
  } else {
    casadi_clear(d_nlp.lam+108, 72);
  }
  d->prob = &p;
  p.sp_h = casadi_s1;
  p.sp_a = casadi_s0;
  p.merit_memsize = 4;
  p.max_iter_ls = 3;
  p.nlp = &p_nlp;
  casadi_sqpmethod_init(d, &arg, &res, &iw, &w, 0, 0);
  casadi_clear(d->dx, 108);
  /* MAIN OPTIMIZATION LOOP */
  while (1) {
    /* Evaluate f, g and first order derivative information */
    d->arg[0] = d_nlp.z;
    d->arg[1] = d_nlp.p;
    d->res[0] = &d_nlp.objective;
    d->res[1] = d->gf;
    d->res[2] = d_nlp.z+108;
    d->res[3] = d->Jk;
    if (casadi_f6(d->arg, d->res, d->iw, d->w, 0)) return 1;
    /* Evaluate the gradient of the Lagrangian */
    casadi_copy(d->gf, 108, d->gLag);
    casadi_mv(d->Jk, casadi_s0, d_nlp.lam+108, d->gLag, 1);
    casadi_axpy(108, 1.0, d_nlp.lam, d->gLag);
    /* Primal infeasability */
    pr_inf = casadi_max_viol(180, d_nlp.z, d_nlp.lbz, d_nlp.ubz);
    /* inf-norm of lagrange gradient */
    du_inf = casadi_norm_inf(108, d->gLag);
    /* inf-norm of step */
    dx_norminf = casadi_norm_inf(108, d->dx);
    /* Checking convergence criteria */
    if (iter_count >= 0 && pr_inf < 1e-06 && du_inf < 1e-06) break;
    if (iter_count >= 50) break;
    if (iter_count >= 1 && iter_count >= 0 && dx_norminf <= 1e-10) break;
    /* Update/reset exact Hessian */
    d->arg[0] = d_nlp.z;
    d->arg[1] = d_nlp.p;
    d->arg[2] = &one;
    d->arg[3] = d_nlp.lam+108;
    d->res[0] = d->Bk;
    if (casadi_f7(d->arg, d->res, d->iw, d->w, 0)) return 1;
    /* Formulate the QP */
    casadi_copy(d_nlp.lbz, 180, d->lbdz);
    casadi_axpy(180, -1.0, d_nlp.z, d->lbdz);
    casadi_copy(d_nlp.ubz, 180, d->ubdz);
    casadi_axpy(180, -1.0, d_nlp.z, d->ubdz);
    /* Initial guess */
    casadi_copy(d_nlp.lam, 180, d->dlam);
    casadi_clear(d->dx, 108);
    /* Increase counter */
    iter_count++;
    /* Solve the QP */
    d->arg[0] = 0;
    d->arg[1] = 0;
    d->arg[2] = 0;
    d->arg[3] = 0;
    d->arg[4] = 0;
    d->arg[5] = 0;
    d->arg[6] = 0;
    d->arg[7] = 0;
    d->arg[8] = 0;
    d->arg[9] = 0;
    d->arg[10] = 0;
    d->arg[11] = 0;
    d->arg[0] = d->Bk;
    d->arg[1] = d->gf;
    d->arg[7] = d->dx;
    d->arg[8] = d->dlam;
    d->arg[9] = d->dlam+108;
    d->arg[5] = d->lbdz;
    d->arg[6] = d->ubdz;
    d->arg[2] = d->Jk;
    d->arg[3] = d->lbdz+108;
    d->arg[4] = d->ubdz+108;
    d->res[0] = 0;
    d->res[1] = 0;
    d->res[2] = 0;
    d->res[3] = 0;
    d->res[0] = d->dx;
    d->res[3] = d->dlam;
    d->res[2] = d->dlam+108;
    ret = casadi_f8(d->arg, d->res, d->iw, d->w, 0);
    if (ret == -1000) return -1000;
    /* Calculate penalty parameter of merit function */
    sigma = casadi_fmax(sigma, (1.01*casadi_norm_inf(180, d->dlam)));;
    /* Calculate L1-merit function in the actual iterate */
    l1_infeas = casadi_sum_viol(180, d_nlp.z, d_nlp.lbz, d_nlp.ubz);
    l1 = d_nlp.objective + sigma * l1_infeas;
    /* Detecting indefiniteness */
    /* Right-hand side of Armijo condition */
    F_sens = casadi_dot(108, d->dx, d->gf);
    tl1 = F_sens - sigma * l1_infeas;
    /* Stepsize */
    t = 1.0;
    /* Merit function value in candidate */
    l1_cand = 0.0;
    /* Reset line-search counter, success marker */
    ls_iter = 0;
    /* Line-search loop */
    while (1) {
      /*  Increase counter */
      ls_iter++;
      /* Candidate step */
      casadi_copy(d_nlp.z, 108, d->z_cand);
      casadi_axpy(108, t, d->dx, d->z_cand);
      /* Evaluating objective and constraints */
      d->arg[0] = d->z_cand;
      d->arg[1] = d_nlp.p;
      d->res[0] = &fk_cand;
      d->res[1] = d->z_cand+108;
      if (casadi_f5(d->arg, d->res, d->iw, d->w, 0)) {
        /* Avoid infinite recursion */
        if (ls_iter == 3) {
          break;
        }
        /* line-search failed, skip iteration */
        t = 0.8* t;
        continue;
      }
      /* Calculating merit-function in candidate */
      l1_cand = fk_cand + sigma * casadi_sum_viol(180, d->z_cand, d_nlp.lbz, d_nlp.ubz);
      if (l1_cand <= l1 + t * 0.0001* tl1) {
        break;
      }
      /* Line-search not successful, but we accept it. */
      if (ls_iter == 3) {
        break;
      }
      /* Backtracking */
      t = 0.8* t;
    }
    /* Candidate accepted, update dual variables */
    casadi_scal(180, 1-t, d_nlp.lam);
    casadi_axpy(180, t, d->dlam, d_nlp.lam);
    casadi_scal(108, t, d->dx);
    /* Take step */
    casadi_axpy(108, 1.0, d->dx, d_nlp.z);
  }
  d->arg[0] = d_nlp.z;
  d->arg[1] = d_nlp.p;
  d->arg[2] = &one;
  d->arg[3] = d_nlp.lam+108;
  d->res[0] = 0;
  d->res[1] = 0;
  d->res[2] = 0;
  d->res[3] = d_nlp.lam_p;
  if (casadi_f4(d->arg, d->res, d->iw, d->w, 0)) return 1;
